INSERT INTO `content` VALUES (2,'terms_of_service','\n<p>1. Binding Agreement. This Terms of Service Agreement (\"Agreement\") is a legally binding document between the warranty holder (\"You\" or \"Your\") and Nationwide Home Warranty (\"Nationwide\").  This Agreement constitutes the entire and only agreement between You and Nationwide.  This Agreement supersedes all prior or contemporaneous agreements, representations, warranties and understandings between You and Nationwide.  This Agreement provides for home warranty services only and should not be confused with an insurance contract.  Your home warranty coverage remains with the home covered and cannot be transferred to a different home.  This Agreement covers household appliances and systems when they become inoperable due to normal wear and tear.  This Agreement sets forth all of the household appliances and systems covered under this Agreement and the specific items that are excluded from coverage.  In the event an appliance or system is not mentioned in this Agreement, it will not be covered under this Agreement.  Please read the entire Agreement before retaining the services of Nationwide.</p>\n\n<p>2.  Obligations.   In consideration for your payment to Nationwide, and subject to all of the terms of this Agreement, Nationwide will arrange for a qualified service contractor and/or technician (\"Nationwide Service Technician\") to repair or replace the systems and appliances covered under this Agreement, when they become inoperable due to normal wear and tear. </p>\n\n<p>3.  Covered Homes.  This Agreement only covers systems and appliances in single-family dwelling, individual condominium units, town houses and modular homes.  Only those systems and appliances properly and permanently installed and located within the perimeter of the main foundation of the home will be covered.  This Agreement will not cover systems or appliances within (i) commercial properties; (ii) residential properties used for business purposes, including, but not limited to, dwellings used for rest homes, day care centers, schools and/or professional offices; and (iii) common areas of condominiums, multi-family houses and/or cooperatives.  This Agreement will not cover any system or appliance designated by the manufacturer as being used for commercial use.</p>\n\n<p>4.  Term.  The term of Your warranty coverage, as set forth in this Agreement, shall begin #{wait_period_text_override!} (#{wait_period_days_override!}) days following Nationwide\'s acceptance and receipt of Your application, provided that all outstanding payments and premiums due to Nationwide are received by Nationwide (\"Effective Date\").  In the event Nationwide does not receive all outstanding payments and/or premiums outstanding, for any reason, Your warranty coverage term will not begin.  Your warranty coverage will be begin on the Effective Date and remain in effect for one (1) calendar year following the Effective Date (\"Termination Date\").  </p>\n\n<p>5.  Claims Procedure.</p>\n\n<p>5.1.  Before Making a Claim.  Prior to making a claim you should:</p>\n\n<p>(i)  	Immediately contact the proper authority in the event the malfunctioning appliance or system has the potential to cause injury to You or anyone else present in or near your home; </p>\n\n<p>(ii)  	Shut down the malfunctioning appliance or system to prevent further damage; and</p>\n\n<p>(iii) 	Determine if the malfunctioning appliance or system is covered under this Agreement.</p>\n\n<p>5.2.  If Covered.  If this Agreement covers the malfunctioning appliance or system, you MUST contact Nationwide PRIOR to obtaining service on the malfunctioning appliance or system.  Your failure to contact Nationwide prior to obtaining service may render your claim invalid.  Nationwide will not reimburse You if You use your own service technician without first obtaining Nationwide\'s prior authorization.</p>\n\n<p>5.2.1.  Nationwide Service Call Fee.  Each time a Nationwide Service Technician is scheduled and dispatched to Your home, You will be required to pay the Nationwide Service Call Fee in the amount of #{service_fee_text_override!} ($#{service_fee_amt_override!}) Dollars, or the actual cost of repair and/or replacement, whichever is less.  You will be required to pay the Nationwide Service Call Fee regardless of whether all or part of the claim is granted, excluded, limited or denied by Nationwide.  You will be required to pay the Nationwide Service Call Fee once the Nationwide Service Technician begins traveling to your home, regardless of whether you are able to provide access to your home for the Nationwide Service Technician or if you cancel the appointment while the Nationwide Service Technician is traveling to your home.  Additional charges may apply to the Nationwide Service Call Fee.  The Nationwide Service Call Fee, which must be paid at the time and place of appointment, shall be paid by You to the Nationwide Service Technician or directly to Nationwide, at Nationwide\'s option.  In the event You fail to pay the Nationwide Service Call Fee, You will not be able to schedule any additional service calls and your home warranty coverage will be suspended until all outstanding fees are paid in full.  Suspension of your home warranty coverage will not alter or extend the Termination Date of your home warranty coverage.   </p>\n\n<p>5.3.  Contact Information.  A Nationwide representative can be reached  by telephone at 718-943-6920 or by e-mail at info@nationwidehomewarranty.com.   </p>\n\n<p>5.4.  Non-Emergency Claims.  To make a claim for repair you must contact Nationwide immediately following discovery of the malfunctioning and/or inoperability of the system or appliance.  The Nationwide Service Technician will be instructed to provide repair or replacement of the appliance or system within two (2) days during normal business hours and four(4) days on weekends and holidays following submission of the claim.  If covered by this agreement, the system and/or appliance repaired or replaced will be paid for by Nationwide within a reasonable time following submission of the claim.  Nationwide will not be liable for any delay in the repair and/or replacement of the inoperable appliance or system.</p>\n\n<p>5.5.  Emergency Claims.   In the event of an emergency, in order for Nationwide to make a determination if the system and/or appliance causing the emergency is covered under this Agreement, You must contact Nationwide prior to having the repair or replacement work performed.  In the event the emergency pertains to gas, fire or has the potential to cause injury to You or anyone else present in or near your home, you should take all reasonable steps, including, but not limited to, vacating the premises and contacting the proper authority to ensure the safety of You and those present.  Once the determination is made by the proper authority that your home is safe to re-inhabit, You must contact Nationwide immediately and advise them of this claim. </p>\n\n<p>6.  Covered Systems and Appliances.</p>\n\n<p>6.1.  Generally.  </p>\n\n<p>6.1.1.  Proper Working Order.  All systems and appliances must be in proper working order on the Effective Date of the warranty coverage, as set forth in the schedule page accompanying this Agreement.  Any pre-existing conditions or defects causing the malfunction of system or appliance during the term will not be covered by this Agreement.  If a defective or malfunctioning system or appliance is discovered by an inspection company prior to the transfer of ownership of the property or by a utility company at the time of the transfer of ownership, said condition shall be deemed a pre-existing condition and not covered under this Agreement.  </p>\n\n<p>6.1.2.  Manufacturer\'s Warranty.  All systems and appliances covered under either the manufacturer\'s,  distributor\'s, or any other express or implied warranty will not be covered under this Agreement.  </p>\n\n<p>6.2.   Appliances Covered.  This Agreement covers the following appliances:</p>\n\n<p>6.2.1  Refrigerator.  This Agreement covers one (1) refrigerator located within the kitchen of the covered home.  This Agreement covers all modules, components and parts of the refrigerator necessary to the functionality of the refrigerator.  </p>\n\n<p>This Agreement does NOT cover the following list of modules, components and parts relating to the refrigerator: (i) glass displays; (ii) light bulbs; (iii) knobs and caps; (iv) dials; (v) door seals; (vi) gaskets; (vii) door hinges; (viii) door handles; (ix) shelves; (x) condensation pans; (xi) leveling feet; (xii) clogged drains; (xiii) clogged lines; (xiv) grates; (xv) ice makers; (xvi) ice crushers; (xvii) beverage dispensers; (xviii) thermal shells; (xix) cosmetic issues or abnormalities; and (xx) freezers, freezer parts and components which are not essential to the refrigerator unit as a whole.</p>\n\n\n<p>6.2.2.  Oven/Range/Stove Top.</p>\n\n<p>This Agreement covers all modules, components and parts of the gas or electric oven, range and stove top necessary to the functionality of the oven, range and/or stove top.</p>\n\n<p>This Agreement does NOT cover the following list of modules, components and parts relating to the oven, range or stove top: (i) door handles; (ii) door hinges; (iii) doors; (iv) clocks; (v) racks; (vi) meat probe components; (vii) range hood filters; (viii) rotisserie components; (ix) leveling feet/rollers; (x) shelves; (xi) light bulbs; (xii) grates; (xiii) buttons; (xiv) glass; (xv) trays; (xvi) knobs; (xvii) burner bowls and covers; (xviii) backsplashes; and (xix) cosmetic issues or abnormalities.</p>\n\n<p>6.2.3.  Built-In Microwave Oven. </p>\n\n<p>This Agreement covers all modules, components and parts of the built-in microwave oven necessary to the functionality of the built-in microwave oven.</p>\n\n<p>This Agreement does NOT cover portable or countertop microwave ovens.  This Agreement does NOT cover the following list of modules, components and part relating to the built-in microwave oven: (i) door handles; (ii) door hinges; (iii) doors; (iv) clocks; (v) racks; (vi) meat probe components; (vii) knobs, caps and buttons ; (viii) rotisserie components; (ix) interior facing/lining ; (x) shelves; (xi) light bulbs; (xii) grates; (xiii) glass; (xiv) trays; (xv)  cosmetic issues or abnormalities; and (xvi) components relating to installation/mounting.</p>\n\n<p>6.2.4.  Dishwasher.</p>\n\n<p>This Agreement covers all modules, components and parts of the dishwasher necessary to the functionality of the dishwasher.</p>\n\n<p>This Agreement does NOT cover the following list of modules, components and parts relating to the dishwasher: (i) all components relating to dishwasher racks/baskets; (ii) light bulbs; (iii) knobs, caps and buttons; (iv) dials; (v) door seals; (vi) gaskets; (vii) door hinges; (viii) door handles; (ix) components relating to installation/mounting; (x) rinse aids; (xi) leveling feet; (xii) clogged drains; (xiii) clogged lines; (xiv) grates; (xv) cosmetic issues or abnormalities; and (xvi) paneling and trim.</p>\n\n<p>6.2.5.  Garbage Disposal/Trash Compactor.</p>\n\n<p>This Agreement covers all modules, components and parts of the garbage disposal and trash compactor necessary to the functionality of the garbage disposal and trash compactor.</p>\n\n<p>This Agreement does NOT cover normal and ordinary garbage disposal/trash compactor failures such as jamming and resetting.  This Agreement does NOT cover the following list of modules, components and parts relating to the garbage disposal and trash compactor: (i) locks; (ii) clips; (iii) paneling and trim; (iv) components relating to installation/mounting; (v) leveling feet; (vi) stoppers; (vii) flanges; (viii) rings; (ix) cosmetic issues or abnormalities; (x) removal buckets; (xi) glass displays; (xii) knobs, caps and buttons; (xiii) dials; (xiv) door seals; (xv) gaskets; (xvi) hinges; (xvii) handles; (xviii) shelves; and (xix)  replacement bags.</p>\n\n<p> 6.2.6.  Clothes Washer/Clothes Dryer.</p>\n\n<p>This Agreement covers all modules, components and parts of the clothes washer and clothes dryer necessary to the functionality of the clothes washer and clothes dryer.</p>\n\n<p>This Agreement does NOT cover any damages made to clothing as a result of being washed and/or dried by the covered clothes washer and/or clothes dryer.  This Agreement does NOT cover the following list of modules, components and parts relating to the clothes washer and clothes dryer:  (i) dispensers; (ii) light bulbs; (iii) knobs, caps and buttons; (iv) dials; (v) door seals; (vi) gaskets; (vii) door hinges; (viii) door handles; (ix) components relating to installation/mounting; (x) glass displays; (xi) leveling feet; (xii) clogged drains; (xiii) clogged lines; (xiv) clogged ducts and/or clogged venting; (xvi) lint/filter screens; (xvii) grates; (xviii) rinse aids (xix) cosmetic issues or abnormalities; and (xx) paneling and trim.</p>\n\n<p>6.3.  Systems Covered.  This Agreement covers the following systems:</p>\n\n<p>6.3.1.  Plumbing.  This Agreement covers the following plumbing system components:  (i) line leaks in gas, water, drain, waste or vent lines not caused by damage resulting from freezing or from roots; (ii) line breaks in gas, water, drain, waste or vent lines not caused by damage resulting from freezing or from roots; (iii) cleanout of stopped or clogged drains and vents; (iv) cleanout of stopped sewer lines (not to exceed 100 feet from access point); (v) toilet bowls; (vi) toilet tanks; (vii) toilet flushing mechanisms; (viii) tub and shower valves; (ix) angle stops; (x) risers;  (xi) gate valves; (xii) permanent ground water sump pumps; (xiii) built-in bathtub whirlpool motor and pump components.</p>\n\n<p>; (xiv) line shutoff valve</p>\n\n<p>This Agreement does NOT cover the following list of modules, components and parts relating to the plumbing system: (i) faucets; (ii) fixtures; (iii) sinks; (iv) showers/shower stalls/shower modules; (v) shower heads/arms; (vi) bathtubs; (vii) bath/shower doors; (viii) tub and shower base pans; (ix) water conditioning equipment; (x) line leaks/breaks/stoppages caused by freezing, root damage or foreign objects; (xi) line leaks/breaks/stoppages caused by collapsed, damaged or broken drain, vent or sewer lines outside the main foundation of the covered home; (xii) access to drain or sewer lines from the vent or removal of the water closet; (xiii) septic tanks; (xiv) costs associated with locating, accessing or installing a ground level cleanout; (xv) toilet lids; (xvi) toilet seats;  (xvii) caulk/sealants; (xviii), water softeners; (xix) pressure regulators; (xx) inadequate or excessive water pressure, water flow/capacity restrictions caused by rust, calcification and/or mineral/chemical deposits; (xxi) water discoloration; (xxii) septic tanks; (xxiii) holding/storage tanks; (xxiv) sewage ejector pumps; (xxv) plumbing components relating to hose bibs, landscaping sprinkler systems, fire suppression systems, saunas and/or steam rooms; (xxvi) lead drain lines/pipes; (xxvii) tile; and (xxviii) grout.</p>\n\n<p>6.3.2. Plumbing Stoppages. This Agreement covers stoppages in drain, vent and sewer lines up to 100 feet from access point, except if caused by roots. Mainline stoppages are only cleared when there is an accessible ground level clean out.</p>\n\n<p>This Agreement does NOT cover Stoppages caused by collapsed, damaged or broken drain, vent or sewer lines outside the confines of the main foundation if the home. Stoppages due to roots or foreign objects. If the lines are broken or infiltrated by roots or are otherwise stopped by roots, even if he break, infiltration or stoppage is within 100 feet from the access point, it is not covered. Access to drain or sewer lines from the vent or the removal of the water closet. Costs to locate, access or install a ground level clean out. Septic tanks.</p>\n\n<p>6.3.3.  Water Heating.  This Agreement covers all modules, components and parts of the water heating system necessary to the functionality of the water heater system.</p>\n\n<p>   </p>\n\n<p>This Agreement does NOT cover solar water heating systems or the components thereof.  This Agreement does NOT cover the following list of modules, components and parts relating to the water heating system:  (i) holding tanks; (ii) storage tanks; (iii) fuel storage tanks; (iv) vents; (v) flues; (vi) drain pans; (vii) drain piping; (viii) pressure reducing valve; (ix) internal flue; (x) draft hood; (xi) flue baffle; and (xii) tempering valve.</p>\n\n<p>6.3.4.  Heating System (Primary Only).  This Agreement covers all module, components and parts of the heating system necessary to the functionality of the heating system.  This Agreement covers the primary heating system of the covered home only, provided that the heating system does not exceed a five (5) ton capacity. </p>\n\n<p>This Agreement does NOT cover solar heating systems or the components thereof.  This Agreement does NOT cover any portable heating units or wall units or components thereof.  This Agreement does NOT cover fireplaces or heat lamps or the components thereof.  This Agreement does NOT cover radiant heating systems built into walls, ceilings or floors.  This Agreement does NOT cover the following list of modules, components and parts relating to the heating system: (i) cleaning or replacing filters; (ii) air cleaners; (iii) humidifiers; (iv) baseboard casings; (v) fuel storage tanks; (vi) filters; (vii) registers; (viii) purging; (ix) grills; (x) clocks and timers; (xi) flues; (xii) flue baffles; (xiii) damper motors; (xiv) wiring; (xv) fire box; (xvi) coils; (xvii) heating jacket and trim; (xviii) heat transfer components; (xix) piping; (xx) source pipes for geothermal heating/cooling units; (xxi) malfunction due to inadequate or undersized equipment or ductwork; (xxii) water piping; (xxiii) valves; and (xxiv) insulation;(xxv) clogged lines.  </p>\n\n<p>Nationwide will pay a maximum of One Thousand Five Hundred ($1,500.00) Dollars for access, diagnosis and repair and/or replacement of any system during each consecutive twelve (12) month period beginning on the Effective Date and continuing to the Termination Date, unless otherwise terminated by You or Nationwide.</p>\n\n\n\n<p>6.3.5.  Electrical.  This Agreement covers the following electrical system components: (i) wiring; (ii) service panels; (iii) sub-panels (iv) switches; (iv) breakers; (v) outlets; (vi) junction boxes; (vii) ground fault interrupters; and (viii) exhaust fans.</p>\n\n<p>This Agreement does NOT cover damage to the electrical system caused by flood, fire, water, rust, corrosion and lightning.  This Agreement does NOT cover the following list of modules, components and parts relating to the electrical system: (i) fixtures; (ii) alarm equipment; (iii) doorbells; (iv) intercom equipment; (v) inadequate wiring capacity; (vi) damage caused by double or triple tapping; (vii) inadequate wiring capacity; (viii) ceiling fans; (ix) attic fans; (x) damage caused by a power surge; (xi) damage caused by a power failure; (xii) central vacuum systems; and (xiii) garage door openers.</p>\n\n<p>6.3.6.  Ducts.  This Agreement covers all ducts from heating and/or cooling unit to the point of attachment at registers or grills.  </p>\n\n<p>This Agreement does NOT cover the following list of modules, components and parts relating to the duct system:  (i) grills; (ii) registers; (iii) flue ducts; (iv) dampers; (v) diffusers; (vi) regulators; (vii) boxes; (viii) panels; (ix) insulation; (x) ductwork insulated by asbestos; (xi) collapsed ductwork; (xii) crushed ductwork; and (xiii) improperly sized ductwork/duct system. </p>\n\n<p>6.3.7.  Air Conditioning (Central).  This Agreement covers the primary air conditioning system of the covered home only, provided that the air conditioning system does not exceed a five (5) ton capacity.  This Agreement covers the following air conditioning components: (i) motors; (ii) compressors; (iii) condensers; and (iv)thermostats.</p>\n\n<p>This Agreement does NOT cover window, wall or portable air conditioning units.  This Agreement does NOT cover (i) air filters; (ii) Freon; (iii) Freon recapture; (iv) geothermal systems; (v) gas or propane air condition systems; (vi) air filtration systems; (vii) humidifiers; (viii) registers; (ix) grills; (x) stands; (xi) jacks; (xii) condenser casings; (xiii) pads; (xiv) vents; (xv) flues; (xvi) clogged lines; (xvii) condensation leaks; (xviii) mismatched systems; (xix) damaged ducts; (xx) improper wiring; and (xxi) improper piping.</p>\n\n<p>6.3.8.  Garage Door Opener.  This Agreement covers the following garage door opener components:  (i) control board; (ii) motors; (iii) chains; (iv) belts; (v) gears; (vi) pulley; (vii) sheave fork; (viii) axle bolts; and (ix) switches.</p>\n\n<p>This Agreement does NOT cover the following list of modules, components and parts relating to the garage door opener system: (i) garage doors; (ii) locks; (iii) springs; (iv) adjustments; (v) brackets; (vi) rollers; (vii) hinges; (viii) glass paneling; (ix) knobs; (x) buttons; (xi) wall switches; (xii) lock cable; (xiii) tracks; (xiv) rails; (xv) drums; (xvi) light bulbs; (xvii) light coverings; (xviii) mounting equipment and components; and (xix) alarm system components. </p>\n\n<p>6.3.9.  Ceiling Fans.  This Agreement covers all modules, components and parts of ceiling fans affixed in the covered home necessary to their functionality.</p>\n\n<p>6.4.  Additional Coverage Options.   The following is a list of covered systems and appliances which You have the option to purchase from Nationwide.  The following components will only be covered if You advise Nationwide that you wish to add the additional home warranty coverage and Nationwide is in receipt of the additional payment for said coverage.  You may purchase the additional for up to thirty (30) days following the Effective Date of the home warranty coverage but coverage for the additional coverage option will not take effect until payment is received by Nationwide for the additional coverage and the addition coverage will terminate on the Termination Date.</p>\n\n<p>6.4.1.  Home Office.  This Agreement provides coverage for up to one (1) computer and one (1) monitor one (1) printer and one (1) fax machine or multi-function machine . The covered product(s) must be five (5) years old or less and used primarily for personal, family or household purposes. Your actual covered product(s) will be listed on the Schedule page.HARDWARE includes but is not limited to the following: Computers (CPU, Internal Hard Drive, Internal Floppy Drive, Graphics Card, NIC Cards, Motherboard, Optical Drives, Power Supply, Sound Card). Peripherals such as Monitors, Printers (including all-in-one devices), Fax Machines, Mouse, Keyboard, and Speakers.</p>\n\n<p>6.4.2.  Limited Roof Leak.  This Agreement applies to roof leak repairs over the occupied living area of single family homes only.  This Agreement covers the roof leaks only.</p>\n\n<p>This Agreement does NOT cover the following list of modules, components and parts relating to roof leaks:  (i) patios; (ii) porches, (iii) decks; (iv) metal roofs; (v) foam roofs; (vi) masonite (hardboard, omni board, woodruff) shingles; (vii) cemwood shakes; (viii) cracked and/or missing material; (ix) tiles;  (x) tar and gravel; (xi) flat or built-up roofs; (xii) structural leaks; (xiii) asphalt; (xiv) gutters; (xv) downspouts; (xvi) skylights; (xvii) flashing; (xviii) patio covers; (xix) solar components; (xx) attic vents; (xxi) roof jacks; (xxii) satellite components; (xxiii) antennae; and (xxiv) chimney components.</p>\n\n<p>This Agreement does NOT cover repairs requiring partial or complete replacement of the roof.</p>\n\n<p>6.4.3.  Pool/Spa Equipment.  This Agreement applies to the following list of pool/spa components: (i) all components of the pumping system; (ii) all components of the filtration system; (iii) all components of the heating system.  This Agreement covers both the pool and/or hot tub or spa if they use common equipment.  In the event the pool and spa or hot tub do not use the common equipment, then only one will be covered.   </p>\n\n<p>This Agreement does NOT cover portable pools, spas or hot tubs.  This Agreement does NOT cover the following list of modules, components and parts relating to the pool/spa: (i) pool sweep motors; (ii) lights; (iii) liners; (iv) structural defects; (v) solar equipment; (vi) jets; (vii) control switches; (viii) computerized control boards; (ix) ornamental fountains, waterfalls and their components; (x) pool covers; (xi) fill line and fill valve; (xii) built-in or detachable cleaning equipment including, but not limited to, pool sweeps, pop up heads, turbo valves; (xiii) pool chemicals; (xiv) skimmers; (xv) chlorinators; (xvi) fuel storage tanks; (xvii) heat pumps; (xviii) ionizers; and (xix) disposable filtration components.</p>\n\n<p>6.4.4.  Well Pump.  This Agreement covers all components of well pump, provided the well is the primary water source to the covered home. </p>\n\n<p>This Agreement does NOT cover the following list of modules, components and parts relating to the well pump: (i) well casings; (ii) holding and storage tanks; (iii) piping or electrical lines leading to or connecting pressure tank and covered home; (iv) re-drilling of wells; (v) booster pumps; and (vi) components for geothermal/heat pumps.</p>\n\n<p>6.4.5.  Sump Pump.  This Agreement covers all components of sump pump for ground water, provided the pump is  within the foundation of the covered home.</p>\n\n<p>This Agreement does NOT cover the following list of modules, components and parts relating to the sump pump: (i) portable pumps; and (ii) sewer ejector pumps.</p>\n\n<p>6.4.6.  Central Vacuum.  This Agreement covers all modules, components and parts of central vacuum system necessary to its functionality.</p>\n\n<p>This Agreement does NOT cover the following list of modules, components and parts relating to the central vacuum system: (i) vacuum nozzles; (ii) clogged pipes; (iii) hoses; and (iv) vacuum accessories. </p>\n\n<p>6.4.7.  Second Refrigerator.  This Agreement covers all modules, components and parts of a second refrigerator necessary to its functionality.</p>\n\n<p>This Agreement does NOT cover the following list of modules, components and parts relating to the  second refrigerator: (i) glass displays; (ii) light bulbs; (iii) knobs and caps; (iv) dials; (v) door seals; (vi) gaskets; (vii) door hinges; (viii) door handles; (ix) shelves; (x) condensation pans; (xi) leveling feet; (xii) clogged drains; (xiii) clogged lines; (xiv) grates; (xv) ice makers; (xvi) ice crushers; (xvii) beverage dispensers; (xviii) thermal shells; (xix) cosmetic issues or abnormalities; and (xx) freezers, freezer parts and components which are not essential to the refrigerator unit as a whole.</p>\n\n<p>6.4.8.  Stand Alone Freezer.  This Agreement covers all modules, components and parts of a stand alone freezer necessary to its functionality.</p>\n\n<p>This Agreement does NOT cover the following list of modules, components and parts relating to the  stand alone freezer: (i) glass displays; (ii) light bulbs; (iii) knobs and caps; (iv) dials; (v) door seals; (vi) gaskets; (vii) door hinges; (viii) door handles; (ix) shelves; (x) condensation pans; (xi) leveling feet; (xii) clogged drains; (xiii) clogged lines; (xiv) grates; (xv) ice makers; (xvi) ice crushers; (xvii) beverage dispensers; (xviii) thermal shells; and (xix) cosmetic issues or abnormalities.</p>\n\n<p>6.4.9. Lawn Sprinkler System. This Agreement covers all components that affect operation.</p>\n\n<p>This Agreement does NOT cover Hydraulic Systems-Systems related to fire extinguishing-Malfunctioning due to lack of water pressure- Batteries- Drip irrigation systems-Damage due to freezing, pets, cars, or lawn care equipment.</p>\n\n<p>6.4.10. Septic System Coverage. Aerobic pump, sewage ejector, jet pump, septic tank</p>\n\n<p>This Agreement does NOT cover Tile fields and leach beds, leach lines, lateral lines, insufficient capacity, clean out, pumping. Cost to diagnose, repair and/or replace the additional coverage options, is limited to a total of $400 maximum.</p>\n\n<p>6.4.11. Refrigerator\'s Ice Maker. This Agreement covers all components and parts.</p>\n\n<p>EXCLUDED: Stand alone ice maker (unless separate option purchased).</p>\n\n<p>7.  Nationwide Service Technicians.  Nationwide has the exclusive right to select a service technician to perform the necessary repair and/or replacement services.  Nationwide will not reimburse You in the event a service technician performs, or attempts to perform, any repair and/or replacement services without first being authorized by Nationwide.  If You experience any difficulties or have any disputes with a Nationwide Service Technician, You must contract Nationwide immediately.</p>\n\n<p>8.  Nationwide\'s Option.  Nationwide shall have the sole and exclusive option to:</p>\n\n<p>(i)		Select the Nationwide Service Technician to perform repair and/or replacement services;</p>\n\n<p>(ii)	In the event a covered system or appliance is deemed irreparable or it is not cost effective to repair, Nationwide may replace the system or appliance with a new system or appliance of like kind and quality, 	the price of which shall not exceed the current retail cost of the system or appliance being replaced;</p>\n\n<p>(iii)	In lieu of replacing a system or appliance that is deemed irreparable, said determination being made by Nationwide, Nationwide may choose to pay a cash settlement for the irreparable component of the system or appliance.  The cash settlement shall be in an amount not to exceed the current retail cost of the component being replaced;</p>\n\n<p>(iv)	Select the manufacturer, make and model of any replacement parts used in the repair of the defective system or appliance; and</p>\n\n<p>(v)		Obtain a second opinion with regard to the cost of replacement without any additional cost to You.</p>\n\n<p>9.  Exclusions to Coverage.  </p>\n\n<p>9.1  Exclusions Generally.  The following is a list of systems and/or appliances that are NOT covered by this Agreement.  In the event this paragraph conflicts with any other provisions in this Agreement, this paragraph shall be controlling.</p>\n\n<p>9.1.1.  Hazardous Material.  This Agreement does not cover any systems, appliances and/or services relating to hazardous or toxic material including, but not limited to, acids, asbestos, lead and lead based products and any other hazardous contaminants.</p>\n\n<p>9.1.2.  Improper Installation/Previous Repair.  This Agreement does not cover any systems or appliances that require repair or replacement as a result of improper installation, previous repair, damage caused by any construction activity, improper wiring, inadequate or lack of capacity, power failures, power surges, overloads, missing parts, failure to properly maintain, failure to properly clean, neglect, misuse, corrosion, rust and any modification to the system or appliance. You are responsible for providing maintenance and cleaning on covered items as specified by the manufacturer to ensure continued coverage on such items. Nationwide reserves the right to request maintenance records. For example: heating and a/c systems require periodic cleaning and/or replacement of filters and cleaning of evaporator and condenser coils. Water heaters require periodic flushing.</p>\n\n<p>9.1.3.  Acts of God.  This Agreement does not cover systems or appliances that require repair or replacement as a result of an Act of God, including, but not limited to, storms, earthquake, war, riot, fire, flood, mold, nuclear incidents, vandalism, pests, pets, freezing damage, theft, roots and settlement of earth.</p>\n\n<p>9.1.4.  Foundation/Structure.  This Agreement does not cover any damage and/or defects to the structural components of the covered home, including, but not limited to, the foundation and any beams of the covered home.  </p>\n\n<p>9.1.5.  Manufacturer\'s Defect.  This Agreement does not cover any system or appliance that has malfunctioned as a result of the manufacturer\'s defect, recall and/or defective materials or parts.</p>\n\n<p>9.1.6.  Solar/Smart House.  This Agreement does not cover any systems, appliances, equipment and components, utilized in connection with solar heating or solar power systems.  This Agreement does not cover electronic, computerized or energy management systems or devices, lighting and appliance management systems, such as a \"Smart House\".</p>\n\n<p>10.  Nationwide\'s Liability.</p>\n\n<p>10.1  Dimensions, Brand and Color.  Nationwide will not be responsible for matching a system or appliance\'s color, brand, or dimensions and only is responsible for repairing and/or installing replacement systems or appliances of similar capacity and efficiency.</p>\n\n<p>10.2.  Removal/Disposal.  Nationwide will not be responsible for any costs associated with the removal and/or disposal of any system and/or appliances repaired, or any waste or debris associated with the repair and/or replacement services.</p>\n\n<p>10.3.   Local/State/Federal Government Violation.  Nationwide will not be responsible for repair or replacement of any system or appliance which said repair or replacement would violate any local, state and/or federal laws, rules, codes or regulations.  If a system or appliance cannot be repaired or replaced without violating a local, state or federal law, rule, code or regulation, then Nationwide\'s liability will be limited to a cash settlement which shall be in an amount not to exceed the current retail cost of the product in need of repair or replacement.  If a violation of any local, state and/or federal law, rule, code or regulation is discovered before or during the repair or replacement service, Nationwide will not be required to initiate and/or complete the repair or replacement service until the violation and/or potential violation is corrected by You.  Nationwide will not be responsible for any additional costs associated with the correction of the violation and/or potential violation.  Nationwide will not be responsible for any improvements, services and/or costs required to comply with any local, state and/or federal laws, regulations,  ordinances</p>\n\n<p>10.4.  Access.  It is your responsibility to provide access to the system or appliance in need of repair or replacement.  In the event that the system or appliance cannot be accessed without causing damage to a wall, floor, cabinet or ceiling, Nationwide will not cover and will not be responsible for any wall coverings, floor coverings, cabinets, counter tops, tiling, paint, or for the repair of any structural or cosmetic defects, including, but not limited to, reconfiguring space to accommodate replacement components.  In the event the Nationwide Service Technician must open a surface to gain access to a component, the surface will be restored to a ruff finish.  In the event the Nationwide Service Technician is required to access a component, appliance or system, either to diagnose, repair or replace the component/appliance, which is encased, covered or embedded in concrete, Nationwide will not pay more than Five Hundred ($500.00) Dollars total for accessing, diagnosing and repairing/replacing the component/appliance.</p>\n\n<p>10.5.  Delay.  Nationwide will not be responsible for delays in repairing or replacing a system or appliance resulting from events beyond its control, including, but not limited to, weather conditions, labor disputes, strikes, delivery problems, war or availability of parts.</p>\n\n<p>10.6.  Upgrades.  This Agreement does not cover upgrades to any system or appliance.</p>\n\n<p>11.  Hold Harmless.  You shall keep, save and hold harmless Nationwide from any and all damages and liability arising out of any fault or negligence by You or any failure on Your part to comply with any of the covenants, terms and conditions herein contained.  In case Nationwide shall, without fault on its part, be made a party to any litigation commenced by or against You, You shall protect and hold Nationwide harmless and shall pay all costs, expenses and reasonable attorneys\' fees incurred or paid by Nationwide in connection with such litigation.  You shall also pay all costs, expenses and reasonable attorney\'s fees that may be incurred or paid by Nationwide in enforcing the covenants and terms of this Agreement.</p>\n\n<p>12.  Consequential Damages.  This Agreement does not provide coverage for damage caused by a malfunctioning or inoperable appliance or system, including, but not limited to, water, fire and mold spores.  Nationwide, its employees, agents, shareholders or parent company shall in no way be responsible for any damages, whether in contract or tort, for any malfunctioning or inoperable appliance or system. </p>\n\n<p>13.1.  Cancellation by Nationwide.  Nationwide may cancel this Agreement, therefore voiding this Agreement if it is deemed that You have either:</p>\n\n<p>(i)  	Fraudulent conduct by You; </p>\n\n<p>(ii)  	Misrepresentations by You; </p>\n\n<p>(iii) 	Failed to make the require payments to Nationwide;</p>\n\n<p>(iv)  	Upon mutual agreement between You and Nationwide.  In the event Nationwide agrees to allow You to cancel after the thirtieth day, the You shall be entitled to a pro rata refund of payments made regarding Your home warranty coverage for the remaining term, less an administrative fee 	and any service costs incurred by Nationwide.</p>\n\n<p>13.2.  Cancellation by You.  You may cancel this Agreement within three (3) days from the Order Date of this Agreement, as set forth on the schedule page accompanying this Agreement.  In the event you cancel within the three (3) day period, then You shall be entitled to a full refund of the paid contract fee less a Fifty ($50.00) Dollar administrative fee, if and only if, no service has been provided under the contract.  After the third day, this Agreement shall be non-cancelable by You, unless otherwise agreed by Nationwide.  </p>\n\n<p>14.  Renewal.  In the event You wish to renew this Agreement for an additional term, as set forth in the schedule page accompanying this Agreement, You must contact a Nationwide representative prior to the expiration of your current term.  You will be notified by a Nationwide representative as to the new rates and the new terms of coverage.  Nationwide reserves the right to deny your request for renewal for any reason and change the rate and terms of coverage for the renewed term.</p>\n\n<p>14.1.  Automatic Renewal.  In the event You select the monthly payment option and Nationwide elects to renew your contract, Nationwide will notify You of the rate and term for the renewal period during the tenth month of Your contract and You will be automatically renewed for an annual coverage period unless you notify Nationwide in writing thirty (30) days prior to the Termination Date.  Your first payment for the renewed term will be deemed as authorization for another twelve (12) month term.</p>\n\n<p>15.  Arbitration.  Any disputes resulting from this Agreement or any dispute resulting to Nationwide\'s home warranty service shall be construed and enforced under the laws of the State of New York. You hereby submit to the jurisdiction of the courts of Kings County, New York, and waive any objection to venue with respect to actions brought in such courts. </p>\n\n<p>16.  Severability.  If any provision of these Terms and Conditions is held invalid, illegal, or unenforceable, the validity, legality, or enforceability of the remaining provisions shall in no way be affected or impaired thereby.</p>\n\n ','2009-06-25 23:41:57','2010-01-13 01:10:39'),(3,'testimonials','<h1>Testimonials</h1>\n\n\n\n\n</div>\n\n<div class=\"testimonial\">\n	<p>&ldquo;I just wanted to let you know that my toilet is usable again. Nationwide chipped in $250 to cover this repair, I wanted to take the time and thank you for all of your help.&rdquo;</p>\n	<p>Patti R.</p>\n</div>\n\n\n<div class=\"testimonial stripe\">\n	<p>&ldquo;When my Garbage disposal finally gave up, Nationwide Home Warranty was there to replace it the very next day. Thanks!&rdquo;</p>\n	<p>George S.</p>\n</div>\n\n<div class=\"testimonial\">\n	<p>&ldquo;Boy was I lucky I had a warranty from Nationwide Home Warranty. The replacement cost on my central AC units was $50 instead of $1500! Thank you.&rdquo;</p>\n	<p>Carl B.</p>\n</div>\n\n<div class=\"testimonial stripe\">\n	<p>&ldquo;When my fridge broke I was worried I would have to buy a new one but thanks to Nationwide Home Warranty it was replaced, hassle-free. Thanks&rdquo;</p>\n	<p>Marrisa G.</p>\n</div>\n\n<div class=\"testimonial\">\n	<p>&ldquo;Thank you Nationwide Home Warranty for being there at 2 AM and again the next day to make sure the job was done right.&rdquo;</p>\n	<p>Carol C.</p>\n</div>\n\n<div class=\"testimonial stripe\">\n	<p>&ldquo;When my heater broke down in the dead of winter I was worried, but with Nationwide Home Warranty it was repaired the next day. Thank you.&rdquo;</p>\n	<p>Doug B.</p>\n</div>\n\n<div class=\"testimonial\">\n	<p>&ldquo;Thank you for handling my claim in a timely manner.&rdquo;</p>\n	<p>Deloris</p>\n</div>\n\n\n\n\n\n<div class=\"testimonial stripe\">\n	<p>&ldquo;To Whom it may concern, Mr. Brian Cooper should and hopefully will be commended on his outstanding customer service, and the gracious way he handles those valued customers. He was extremely fair and helpful it the process of my claim. He is a great representative of your company. Thank You for taking the time to read this. A loyal customer!&rdquo;</p>\n	<p>C. M.</p>\n</div>\n\n<div class=\"testimonial\">\n	<p>&ldquo;Thank you for the way in which you handled this matter. Have a good weekend, Mr. Cooper.&rdquo;</p>\n	<p>S. P.</p>\n</div>\n\n<div class=\"testimonial stripe\">\n	<p>&ldquo;I purchased a Home warranty and my salesman was Kevin Moore. He was very helpful. I had trouble receiving an email copy of warranty and I called and he worked very hard with me and faxed a copy to a local office so I could pick up the copy and have it to give to the buyers our home before we left. Just wanted his supervisor to know how helpful and courteous he was.&rdquo;</p>\n	<p>Fran T.</p>\n</div>\n\n<div class=\"testimonial\">\n	<p>&ldquo;Thank you for your time and help. Kevin Moore was very professional and a pleasure to work with.&rdquo;</p>\n	<p>Wyn M.</p>\n</div>\n\n<div class=\"testimonial stripe\">\n	<p>&ldquo;Please note that Mr. John Ryan has resolved my issues in a very timely and professional manner.&rdquo;</p>\n	<p>R. P.</p>\n</div>                                             \n\n<div class=\"testimonial\">\n        <p>&ldquo;Matt did a great job.  I am a Realtor and I will recommend this to all my buyers and friends.&rdquo;</p>\n        <p>Elaine D.- Broker/Sales Director</p>\n</div>\n\n<div class=\"testimonial stripe\">\n	<p>&ldquo;Chris, I wanted to tell you that I called to request for a service on the 27th and the day after that my tenant let me know that the technician already called to make an appointment to come and they wanted to come on the same day. That is an awesome timing, awesome! I like Nationwide already &#9786;&rdquo;</p> \n	<p>Grace A.</p>\n</div>','2009-06-25 23:43:26','2009-10-28 17:42:21'),(4,'terms_and_conditions','<h1>Terms and Conditions</h1>\n<p style=\"text-align: justify;\">\n	1.   In consideration for your payment to Nationwide, and subject to all of the terms of this Agreement, Nationwide will arrange for a qualified service contractor and/or technician (Nationwide Service Technician) to repair or replace the systems and appliances covered under this Agreement, when they become inoperable due to normal wear and tear. <br />\n<br />\n2.  This Agreement only covers systems and appliances in single-family dwelling, individual condominium units, town houses and modular homes, multi family homes\' prices vary.  Only those systems and appliances properly and permanently installed and located within the perimeter of the main foundation of the home will be covered.  This Agreement will not cover systems or appliances within (i) commercial properties; (ii) residential properties used for business purposes, including, but not limited to, dwellings used for rest homes, day care centers, schools and/or professional offices; and (iii) common areas of condominiums, multi-family houses and/or cooperatives.  This Agreement will not cover any system or appliance designated by the manufacturer as being used for commercial use.<br />\n<br />\n4.  Term.  The term of Your warranty coverage, as set forth in this Agreement, shall begin thirty (30) days following Nationwides acceptance and receipt of Your application, provided that all outstanding payments and premiums due to Nationwide are received by Nationwide (Effective Date).  In the event Nationwide does not receive all outstanding payments and/or premiums outstanding, for any reason, Your warranty coverage term will not begin.  Your warranty coverage will be begin on the Effective Date and remain in effect for one (1) calendar year following the Effective Date (Termination Date).  <br />\n<br />\n5.  Claims Procedure.<br />\n<br />\n5.1.  Before Making a Claim.  Prior to making a claim you should:<br />\n<br />\n(i)  	Immediately contact the proper authority in the event the malfunctioning appliance or system has the potential to cause injury to You or anyone else present in or near your home; <br />\n	(ii)  	Shut down the malfunctioning appliance or system to prevent further damage; and<br />\n	(iii) 	Determine if the malfunctioning appliance or system is covered under this Agreement.<br />\n<br />\n5.2.  If Covered.  If this Agreement covers the malfunctioning appliance or system, you MUST contact Nationwide PRIOR to obtaining service on the malfunctioning appliance or system.  Your failure to contact Nationwide prior to obtaining service may render your claim invalid.  Nationwide will not reimburse You if You use your own service technician without first obtaining Nationwides prior authorization.<br />\n<br />\n5.2.1.  Nationwide Service Call Fee.  Each time a Nationwide Service Technician is scheduled and dispatched to Your home, You will be required to pay the Nationwide Service Call Fee in the amount of Sixty ($60.00) Dollars, or the actual cost of repair and/or replacement, whichever is less.  You will be required to pay the Nationwide Service Call Fee regardless of whether all or part of the claim is granted, excluded, limited or denied by Nationwide.  You will be required to pay the Nationwide Service Call Fee once the Nationwide Service Technician begins traveling to your home, regardless of whether you are able to provide access to your home for the Nationwide Service Technician or if you cancel the appointment while the Nationwide Service Technician is traveling to your home.  Additional charges may apply to the Nationwide Service Call Fee.  The Nationwide Service Call Fee, which must be paid at the time and place of appointment, shall be paid by You to the Nationwide Service Technician or directly to Nationwide, at Nationwides option.  In the event You fail to pay the Nationwide Service Call Fee, You will not be able to schedule any additional service calls and your home warranty coverage will be suspended until all outstanding fees are paid in full.  Suspension of your home warranty coverage will not alter or extend the Termination Date of your home warranty coverage.   <br />\n<br />\n5.3.  Contact Information.  A Nationwide representative can be reached by telephone at <strong>718-943-6920</strong> or by email at <a href=\"mailto:info@nationwidehomewarranty.com\">info@nationwidehomewarranty.com</a><br />\n<br />\n5.4.  Non-Emergency Claims.  To make a claim for repair you must contact Nationwide immediately following discovery of the malfunctioning and/or inoperability of the system or appliance.  The Nationwide Service Technician will be instructed to provide repair or replacement of the appliance or system within two (2) days during normal business hours and four(4) days on weekends and holidays following submission of the claim.  If covered by this agreement, the system and/or appliance repaired or replaced will be paid for by Nationwide within a reasonable time following submission of the claim.  Nationwide will not be liable for any delay in the repair and/or replacement of the inoperable appliance or system.<br />\n<br />\n5.5.  Emergency Claims.   In the event of an emergency, in order for Nationwide to make a determination if the system and/or appliance causing the emergency is covered under this Agreement, You must contact Nationwide prior to having the repair or replacement work performed.  In the event the emergency pertains to gas, fire or has the potential to cause injury to You or anyone else present in or near your home, you should take all reasonable steps, including, but not limited to, vacating the premises and contacting the proper authority to ensure the safety of You and those present.  Once the determination is made by the proper authority that your home is safe to re-inhabit, You must contact Nationwide immediately and advise them of this claim. <br />\n<br />\n6.  Covered Systems and Appliances.<br />\n<br />\n6.1.  Generally.  <br />\n<br />\n6.1.1.  Proper Working Order.  All systems and appliances must be in proper working order on the Effective Date of the warranty coverage, as set forth in the schedule page accompanying this Agreement.  Any pre-existing conditions or defects causing the malfunction of system or appliance during the term will not be covered by this Agreement.  If a defective or malfunctioning system or appliance is discovered by an inspection company prior to the transfer of ownership of the property or by a utility company at the time of the transfer of ownership, said condition shall be deemed a pre-existing condition and not covered under this Agreement.  <br />\n<br />\n6.1.2.  Manufacturers Warranty.  All systems and appliances covered under either the manufacturers,  distributors, or any other express or implied warranty will not be covered under this Agreement.  <br />\n<br />\n6.2.   Appliances Covered.  This Agreement covers the following appliances:<br />\n<br />\n6.2.1  Refrigerator.  This Agreement covers one (1) refrigerator located within the kitchen of the covered home.  This Agreement covers all modules, components and parts of the refrigerator necessary to the functionality of the refrigerator.  <br />\n<br />\nThis Agreement does NOT cover the following list of modules, components and parts relating to the refrigerator: (i) glass displays; (ii) light bulbs; (iii) knobs and caps; (iv) dials; (v) door seals; (vi) gaskets; (vii) door hinges; (viii) door handles; (ix) shelves; (x) condensation pans; (xi) leveling feet; (xii) clogged drains; (xiii) clogged lines; (xiv) grates; (xv) ice makers; (xvi) ice crushers; (xvii) beverage dispensers; (xviii) thermal shells; (xix) cosmetic issues or abnormalities; and (xx) freezers, freezer parts and components which are not essential to the refrigerator unit as a whole.<br />\n<br />\n<br />\n6.2.2.  Oven/Range/Stove Top.<br />\n<br />\nThis Agreement covers all modules, components and parts of the gas or electric oven, range and stove top necessary to the functionality of the oven, range and/or stove top.<br />\n<br />\nThis Agreement does NOT cover the following list of modules, components and parts relating to the oven, range or stove top: (i) door handles; (ii) door hinges; (iii) doors; (iv) clocks; (v) racks; (vi) meat probe components; (vii) range hood filters; (viii) rotisserie components; (ix) leveling feet/rollers; (x) shelves; (xi) light bulbs; (xii) grates; (xiii) buttons; (xiv) glass; (xv) trays; (xvi) knobs; (xvii) burner bowls and covers; (xviii) backsplashes; and (xix) cosmetic issues or abnormalities.<br />\n<br />\n6.2.3.  Built-In Microwave Oven. <br />\n<br />\nThis Agreement covers all modules, components and parts of the built-in microwave oven necessary to the functionality of the built-in microwave oven.<br />\n<br />\nThis Agreement does NOT cover portable or countertop microwave ovens.  This Agreement does NOT cover the following list of modules, components and part relating to the built-in microwave oven: (i) door handles; (ii) door hinges; (iii) doors; (iv) clocks; (v) racks; (vi) meat probe components; (vii) knobs, caps and buttons ; (viii) rotisserie components; (ix) interior facing/lining ; (x) shelves; (xi) light bulbs; (xii) grates; (xiii) glass; (xiv) trays; (xv)  cosmetic issues or abnormalities; and (xvi) components relating to installation/mounting.<br />\n<br />\n6.2.4.  Dishwasher.<br />\n<br />\nThis Agreement covers all modules, components and parts of the dishwasher necessary to the functionality of the dishwasher.<br />\n<br />\nThis Agreement does NOT cover the following list of modules, components and parts relating to the dishwasher: (i) all components relating to dishwasher racks/baskets; (ii) light bulbs; (iii) knobs, caps and buttons; (iv) dials; (v) door seals; (vi) gaskets; (vii) door hinges; (viii) door handles; (ix) components relating to installation/mounting; (x) rinse aids; (xi) leveling feet; (xii) clogged drains; (xiii) clogged lines; (xiv) grates; (xv) cosmetic issues or abnormalities; and (xvi) paneling and trim.<br />\n<br />\n6.2.5.  Garbage Disposal/Trash Compactor.<br />\n<br />\nThis Agreement covers all modules, components and parts of the garbage disposal and trash compactor necessary to the functionality of the garbage disposal and trash compactor.<br />\n<br />\nThis Agreement does NOT cover normal and ordinary garbage disposal/trash compactor failures such as jamming and resetting.  This Agreement does NOT cover the following list of modules, components and parts relating to the garbage disposal and trash compactor: (i) locks; (ii) clips; (iii) paneling and trim; (iv) components relating to installation/mounting; (v) leveling feet; (vi) stoppers; (vii) flanges; (viii) rings; (ix) cosmetic issues or abnormalities; (x) removal buckets; (xi) glass displays; (xii) knobs, caps and buttons; (xiii) dials; (xiv) door seals; (xv) gaskets; (xvi) hinges; (xvii) handles; (xviii) shelves; and (xix)  replacement bags.<br />\n<br />\n 6.2.6.  Clothes Washer/Clothes Dryer.<br />\n<br />\nThis Agreement covers all modules, components and parts of the clothes washer and clothes dryer necessary to the functionality of the clothes washer and clothes dryer.<br />\n<br />\nThis Agreement does NOT cover any damages made to clothing as a result of being washed and/or dried by the covered clothes washer and/or clothes dryer.  This Agreement does NOT cover the following list of modules, components and parts relating to the clothes washer and clothes dryer:  (i) dispensers; (ii) light bulbs; (iii) knobs, caps and buttons; (iv) dials; (v) door seals; (vi) gaskets; (vii) door hinges; (viii) door handles; (ix) components relating to installation/mounting; (x) glass displays; (xi) leveling feet; (xii) clogged drains; (xiii) clogged lines; (xiv) clogged ducts and/or clogged venting; (xvi) lint/filter screens; (xvii) grates; (xviii) rinse aids (xix) cosmetic issues or abnormalities; and (xx) paneling and trim.<br />\n<br />\n6.3.  Systems Covered.  This Agreement covers the following systems:<br />\n<br />\n6.3.1.  Plumbing.  This Agreement covers the following plumbing system components:  (i) line leaks in gas, water, drain, waste or vent lines not caused by damage resulting from freezing or from roots; (ii) line breaks in gas, water, drain, waste or vent lines not caused by damage resulting from freezing or from roots; (iii) cleanout of stopped or clogged drains and vents; (iv) cleanout of stopped sewer lines (not to exceed 100 feet from access point); (v) toilet bowls; (vi) toilet tanks; (vii) toilet flushing mechanisms; (viii) tub and shower valves; (ix) angle stops; (x) risers;  (xi) gate valves; (xii) permanent ground water sump pumps; (xiii) built-in bathtub whirlpool motor and pump components.<br />\n; (xiv) line shutoff valve<br />\n<br />\nThis Agreement does NOT cover the following list of modules, components and parts relating to the plumbing system: (i) faucets; (ii) fixtures; (iii) sinks; (iv) showers/shower stalls/shower modules; (v) shower heads/arms; (vi) bathtubs; (vii) bath/shower doors; (viii) tub and shower base pans; (ix) water conditioning equipment; (x) line leaks/breaks/stoppages caused by freezing, root damage or foreign objects; (xi) line leaks/breaks/stoppages caused by collapsed, damaged or broken drain, vent or sewer lines outside the main foundation of the covered home; (xii) access to drain or sewer lines from the vent or removal of the water closet; (xiii) septic tanks; (xiv) costs associated with locating, accessing or installing a ground level cleanout; (xv) toilet lids; (xvi) toilet seats;  (xvii) caulk/sealants; (xviii), water softeners; (xix) pressure regulators; (xx) inadequate or excessive water pressure, water flow/capacity restrictions caused by rust, calcification and/or mineral/chemical deposits; (xxi) water discoloration; (xxii) septic tanks; (xxiii) holding/storage tanks; (xxiv) sewage ejector pumps; (xxv) plumbing components relating to hose bibs, landscaping sprinkler systems, fire suppression systems, saunas and/or steam rooms; (xxvi) lead drain lines/pipes; (xxvii) tile; and (xxviii) grout.<br />\n<br />\n6.3.2. Plumbing Stoppages. This Agreement covers stoppages in drain, vent and sewer lines up to 100 feet from access point, except if caused by roots. Mainline stoppages are only cleared when there is an accessible ground level clean out.<br />\n<br />\nThis Agreement does NOT cover Stoppages caused by collapsed, damaged or broken drain, vent or sewer lines outside the confines of the main foundation if the home. Stoppages due to roots or foreign objects. If the lines are broken or infiltrated by roots or are otherwise stopped by roots, even if he break, infiltration or stoppage is within 100 feet from the access point, it is not covered. Access to drain or sewer lines from the vent or the removal of the water closet. Costs to locate, access or install a ground level clean out. Septic tanks.<br />\n<br />\n6.3.3.  Water Heating.  This Agreement covers all modules, components and parts of the water heating system necessary to the functionality of the water heater system.<br />\n   <br />\nThis Agreement does NOT cover solar water heating systems or the components thereof.  This Agreement does NOT cover the following list of modules, components and parts relating to the water heating system:  (i) holding tanks; (ii) storage tanks; (iii) fuel storage tanks; (iv) vents; (v) flues; (vi) drain pans; (vii) drain piping; (viii) pressure reducing valve; (ix) internal flue; (x) draft hood; (xi) flue baffle; and (xii) tempering valve.<br />\n<br />\n6.3.4.  Heating System (Primary Only).  This Agreement covers all module, components and parts of the heating system necessary to the functionality of the heating system.  This Agreement covers the primary heating system of the covered home only, provided that the heating system does not exceed a five (5) ton capacity. <br />\n<br />\nThis Agreement does NOT cover solar heating systems or the components thereof.  This Agreement does NOT cover any portable heating units or wall units or components thereof.  This Agreement does NOT cover fireplaces or heat lamps or the components thereof.  This Agreement does NOT cover radiant heating systems built into walls, ceilings or floors.  This Agreement does NOT cover the following list of modules, components and parts relating to the heating system: (i) cleaning or replacing filters; (ii) air cleaners; (iii) humidifiers; (iv) baseboard casings; (v) fuel storage tanks; (vi) filters; (vii) registers; (viii) purging; (ix) grills; (x) clocks and timers; (xi) flues; (xii) flue baffles; (xiii) damper motors; (xiv) wiring; (xv) fire box; (xvi) coils; (xvii) heating jacket and trim; (xviii) heat transfer components; (xix) piping; (xx) source pipes for geothermal heating/cooling units; (xxi) malfunction due to inadequate or undersized equipment or ductwork; (xxii) water piping; (xxiii) valves; and (xxiv) insulation;(xxv) clogged lines.  <br />\n<br />\nNationwide will pay a maximum of One Thousand Five Hundred ($1,500.00) Dollars for access, diagnosis and repair and/or replacement of any system during each consecutive twelve (12) month period beginning on the Effective Date and continuing to the Termination Date, unless otherwise terminated by You or Nationwide.<br />\n<br />\n<br />\n<br />\n6.3.5.  Electrical.  This Agreement covers the following electrical system components: (i) wiring; (ii) service panels; (iii) sub-panels (iv) switches; (iv) breakers; (v) outlets; (vi) junction boxes; (vii) ground fault interrupters; and (viii) exhaust fans.<br />\n<br />\nThis Agreement does NOT cover damage to the electrical system caused by flood, fire, water, rust, corrosion and lightning.  This Agreement does NOT cover the following list of modules, components and parts relating to the electrical system: (i) fixtures; (ii) alarm equipment; (iii) doorbells; (iv) intercom equipment; (v) inadequate wiring capacity; (vi) damage caused by double or triple tapping; (vii) inadequate wiring capacity; (viii) ceiling fans; (ix) attic fans; (x) damage caused by a power surge; (xi) damage caused by a power failure; (xii) central vacuum systems; and (xiii) garage door openers.<br />\n<br />\n6.3.6.  Ducts.  This Agreement covers all ducts from heating and/or cooling unit to the point of attachment at registers or grills.  <br />\n<br />\nThis Agreement does NOT cover the following list of modules, components and parts relating to the duct system:  (i) grills; (ii) registers; (iii) flue ducts; (iv) dampers; (v) diffusers; (vi) regulators; (vii) boxes; (viii) panels; (ix) insulation; (x) ductwork insulated by asbestos; (xi) collapsed ductwork; (xii) crushed ductwork; and (xiii) improperly sized ductwork/duct system. <br />\n<br />\n6.3.7.  Air Conditioning (Central).  This Agreement covers the primary air conditioning system of the covered home only, provided that the air conditioning system does not exceed a five (5) ton capacity.  This Agreement covers the following air conditioning components: (i) motors; (ii) compressors; (iii) condensers; and (iv) thermostats.<br />\n<br />\nThis Agreement does NOT cover window, wall or portable air conditioning units.  This Agreement does NOT cover (i) air filters; (ii) Freon; (iii) Freon recapture; (iv) geothermal systems; (v) gas or propane air condition systems; (vi) air filtration systems; (vii) humidifiers; (viii) registers; (ix) grills; (x) stands; (xi) jacks; (xii) condenser casings; (xiii) pads; (xiv) vents; (xv) flues; (xvi) clogged lines; (xvii) condensation leaks; (xviii) mismatched systems; (xix) damaged ducts; (xx) improper wiring; and (xxi) improper piping.<br />\n<br />\n6.3.8.  Garage Door Opener.  This Agreement covers the following garage door opener components:  (i) control board; (ii) motors; (iii) chains; (iv) belts; (v) gears; (vi) pulley; (vii) sheave fork; (viii) axle bolts; and (ix) switches.<br />\n<br />\nThis Agreement does NOT cover the following list of modules, components and parts relating to the garage door opener system: (i) garage doors; (ii) locks; (iii) springs; (iv) adjustments; (v) brackets; (vi) rollers; (vii) hinges; (viii) glass paneling; (ix) knobs; (x) buttons; (xi) wall switches; (xii) lock cable; (xiii) tracks; (xiv) rails; (xv) drums; (xvi) light bulbs; (xvii) light coverings; (xviii) mounting equipment and components; and (xix) alarm system components. <br />\n<br />\n6.3.9.  Ceiling Fans.  This Agreement covers all modules, components and parts of ceiling fans affixed in the covered home necessary to their functionality.<br />\n<br />\n6.4.  Additional Coverage Options.   The following is a list of covered systems and appliances which You have the option to purchase from Nationwide.  The following components will only be covered if You advise Nationwide that you wish to add the additional home warranty coverage and Nationwide is in receipt of the additional payment for said coverage.  You may purchase the additional for up to thirty (30) days following the Effective Date of the home warranty coverage but coverage for the additional coverage option will not take effect until payment is received by Nationwide for the additional coverage and the addition coverage will terminate on the Termination Date.<br />\n<br />\n6.4.1.  Home Office.  This Agreement provides coverage for up to one (1) computer and one (1) monitor one (1) printer and one (1) fax machine or multi-function machine . The covered product(s) must be five (5) years old or less and used primarily for personal, family or household purposes. Your actual covered product(s) will be listed on the Schedule page.HARDWARE includes but is not limited to the following: Computers (CPU, Internal Hard Drive, Internal Floppy Drive, Graphics Card, NIC Cards, Motherboard, Optical Drives, Power Supply, Sound Card). Peripherals such as Monitors, Printers (including all-in-one devices), Fax Machines, Mouse, Keyboard, and Speakers.<br />\n<br />\n6.4.2.  Limited Roof Leak.  This Agreement applies to roof leak repairs over the occupied living area of single family homes only.  This Agreement covers the roof leaks only.<br />\n<br />\nThis Agreement does NOT cover the following list of modules, components and parts relating to roof leaks:  (i) patios; (ii) porches, (iii) decks; (iv) metal roofs; (v) foam roofs; (vi) masonite (hardboard, omni board, woodruff) shingles; (vii) cemwood shakes; (viii) cracked and/or missing material; (ix) tiles;  (x) tar and gravel; (xi) flat or built-up roofs; (xii) structural leaks; (xiii) asphalt; (xiv) gutters; (xv) downspouts; (xvi) skylights; (xvii) flashing; (xviii) patio covers; (xix) solar components; (xx) attic vents; (xxi) roof jacks; (xxii) satellite components; (xxiii) antennae; and (xxiv) chimney components.<br />\nThis Agreement does NOT cover repairs requiring partial or complete replacement of the roof.<br />\n<br />\n6.4.3.  Pool/Spa Equipment.  This Agreement applies to the following list of pool/spa components: (i) all components of the pumping system; (ii) all components of the filtration system; (iii) all components of the heating system.  This Agreement covers both the pool and/or hot tub or spa if they use common equipment.  In the event the pool and spa or hot tub do not use the common equipment, then only one will be covered.   <br />\n<br />\nThis Agreement does NOT cover portable pools, spas or hot tubs.  This Agreement does NOT cover the following list of modules, components and parts relating to the pool/spa: (i) pool sweep motors; (ii) lights; (iii) liners; (iv) structural defects; (v) solar equipment; (vi) jets; (vii) control switches; (viii) computerized control boards; (ix) ornamental fountains, waterfalls and their components; (x) pool covers; (xi) fill line and fill valve; (xii) built-in or detachable cleaning equipment including, but not limited to, pool sweeps, pop up heads, turbo valves; (xiii) pool chemicals; (xiv) skimmers; (xv) chlorinators; (xvi) fuel storage tanks; (xvii) heat pumps; (xviii) ionizers; and (xix) disposable filtration components.<br />\n<br />\n6.4.4.  Well Pump.  This Agreement covers all components of well pump, provided the well is the primary water source to the covered home. <br />\n<br />\nThis Agreement does NOT cover the following list of modules, components and parts relating to the well pump: (i) well casings; (ii) holding and storage tanks; (iii) piping or electrical lines leading to or connecting pressure tank and covered home; (iv) re-drilling of wells; (v) booster pumps; and (vi) components for geothermal/heat pumps.<br />\n<br />\n6.4.5.  Sump Pump.  This Agreement covers all components of sump pump for ground water, provided the pump is  within the foundation of the covered home.<br />\n<br />\nThis Agreement does NOT cover the following list of modules, components and parts relating to the sump pump: (i) portable pumps; and (ii) sewer ejector pumps.<br />\n<br />\n6.4.6.  Central Vacuum.  This Agreement covers all modules, components and parts of central vacuum system necessary to its functionality.<br />\n<br />\nThis Agreement does NOT cover the following list of modules, components and parts relating to the central vacuum system: (i) vacuum nozzles; (ii) clogged pipes; (iii) hoses; and (iv) vacuum accessories. <br />\n<br />\n6.4.7.  Second Refrigerator.  This Agreement covers all modules, components and parts of a second refrigerator necessary to its functionality.<br />\n<br />\nThis Agreement does NOT cover the following list of modules, components and parts relating to the  second refrigerator: (i) glass displays; (ii) light bulbs; (iii) knobs and caps; (iv) dials; (v) door seals; (vi) gaskets; (vii) door hinges; (viii) door handles; (ix) shelves; (x) condensation pans; (xi) leveling feet; (xii) clogged drains; (xiii) clogged lines; (xiv) grates; (xv) ice makers; (xvi) ice crushers; (xvii) beverage dispensers; (xviii) thermal shells; (xix) cosmetic issues or abnormalities; and (xx) freezers, freezer parts and components which are not essential to the refrigerator unit as a whole.<br />\n<br />\n6.4.8.  Stand Alone Freezer.  This Agreement covers all modules, components and parts of a stand alone freezer necessary to its functionality.<br />\n<br />\nThis Agreement does NOT cover the following list of modules, components and parts relating to the  stand alone freezer: (i) glass displays; (ii) light bulbs; (iii) knobs and caps; (iv) dials; (v) door seals; (vi) gaskets; (vii) door hinges; (viii) door handles; (ix) shelves; (x) condensation pans; (xi) leveling feet; (xii) clogged drains; (xiii) clogged lines; (xiv) grates; (xv) ice makers; (xvi) ice crushers; (xvii) beverage dispensers; (xviii) thermal shells; and (xix) cosmetic issues or abnormalities.<br />\n<br />\n6.4.9. Lawn Sprinkler System. This Agreement covers all components that affect operation.<br />\n<br />\nThis Agreement does NOT cover Hydraulic Systems-Systems related to fire extinguishing-Malfunctioning due to lack of water pressure- Batteries- Drip irrigation systems-Damage due to freezing, pets, cars, or lawn care equipment.<br />\n<br />\n6.4.10. Septic System Coverage. Aerobic pump, sewage ejector, jet pump, septic tank<br />\nThis Agreement does NOT cover Tile fields and leach beds, leach lines, lateral lines, insufficient capacity, clean out, pumping. Cost to diagnose, repair and/or replace the additional coverage options,  is limited to a total of $400 maximum.<br />\n<br />\n6.4.11. Refrigerators Ice Maker. This Agreement covers all components and parts.<br />\nEXCLUDED: Stand alone ice maker (unless separate option purchased).<br />\n<br />\n7.  Nationwide Service Technicians.  Nationwide has the exclusive right to select a service technician to perform the necessary repair and/or replacement services.  Nationwide will not reimburse You in the event a service technician performs, or attempts to perform, any repair and/or replacement services without first being authorized by Nationwide.  If You experience any difficulties or have any disputes with a Nationwide Service Technician, You must contract Nationwide immediately.<br />\n<br />\n8.  Nationwides Option.  Nationwide shall have the sole and exclusive option to:<br />\n(i)	Select the Nationwide Service Technician to perform repair and/or replacement services;<br />\n(ii)	In the event a covered system or appliance is deemed irreparable or it is not cost effective to repair, 	Nationwide may replace the system or appliance with a new system or appliance of like kind and quality, 	the price of which shall not exceed the current retail cost of the system or appliance being replaced;<br />\n<br />\n(iii)	In lieu of replacing a system or appliance that is deemed irreparable, said determination being made by 	Nationwide, Nationwide may choose to pay a cash settlement for the irreparable component of the system 	or appliance.  The cash settlement shall be in an amount not to exceed the current retail cost of the 	component being replaced;<br />\n(iv)	Select the manufacturer, make and model of any replacement parts used in the repair of the defective 	system or appliance; and<br />\n(v)	Obtain a second opinion with regard to the cost of replacement without any additional cost to You.<br />\n<br />\n9.  Exclusions to Coverage.  <br />\n9.1  Exclusions Generally.  The following is a list of systems and/or appliances that are NOT covered by this Agreement.  In the event this paragraph conflicts with any other provisions in this Agreement, this paragraph shall be controlling.<br />\n<br />\n9.1.1.  Hazardous Material.  This Agreement does not cover any systems, appliances and/or services relating to hazardous or toxic material including, but not limited to, acids, asbestos, lead and lead based products and any other hazardous contaminants.<br />\n<br />\n9.1.2.  Improper Installation/Previous Repair.  This Agreement does not cover any systems or appliances that require repair or replacement as a result of improper installation, previous repair, damage caused by any construction activity, improper wiring, inadequate or lack of capacity, power failures, power surges, overloads, missing parts, failure to properly maintain, failure to properly clean, neglect, misuse, corrosion, rust and any modification to the system or appliance. You are responsible for providing maintenance and cleaning on covered items as specified by the manufacturer to ensure continued coverage on such items. Nationwide reserves the right to request maintenance records. For example: heating and a/c systems require periodic cleaning and/or replacement of filters and cleaning of evaporator and condenser coils. Water heaters require periodic flushing.<br />\n<br />\n9.1.3.  Acts of God.  This Agreement does not cover systems or appliances that require repair or replacement as a result of an Act of God, including, but not limited to, storms, earthquake, war, riot, fire, flood, mold, nuclear incidents, vandalism, pests, pets, freezing damage, theft, roots and settlement of earth.<br />\n<br />\n9.1.4.  Foundation/Structure.  This Agreement does not cover any damage and/or defects to the structural components of the covered home, including, but not limited to, the foundation and any beams of the covered home.  <br />\n<br />\n9.1.5.  Manufacturers Defect.  This Agreement does not cover any system or appliance that has malfunctioned as a result of the manufacturers defect, recall and/or defective materials or parts.<br />\n<br />\n9.1.6.  Solar/Smart House.  This Agreement does not cover any systems, appliances, equipment and components, utilized in connection with solar heating or solar power systems.  This Agreement does not cover electronic, computerized or energy management systems or devices, lighting and appliance management systems, such as a Smart House.<br />\n<br />\n10.  Nationwides Liability.<br />\n10.1  Dimensions, Brand and Color.  Nationwide will not be responsible for matching a system or appliances color, brand, or dimensions and only is responsible for repairing and/or installing replacement systems or appliances of similar capacity and efficiency.<br />\n<br />\n10.2.  Removal/Disposal.  Nationwide will not be responsible for any costs associated with the removal and/or disposal of any system and/or appliances repaired, or any waste or debris associated with the repair and/or replacement services.<br />\n<br />\n10.3.   Local/State/Federal Government Violation.  Nationwide will not be responsible for repair or replacement of any system or appliance which said repair or replacement would violate any local, state and/or federal laws, rules, codes or regulations.  If a system or appliance cannot be repaired or replaced without violating a local, state or federal law, rule, code or regulation, then Nationwides liability will be limited to a cash settlement which shall be in an amount not to exceed the current retail cost of the product in need of repair or replacement.  If a violation of any local, state and/or federal law, rule, code or regulation is discovered before or during the repair or replacement service, Nationwide will not be required to initiate and/or complete the repair or replacement service until the violation and/or potential violation is corrected by You.  Nationwide will not be responsible for any additional costs associated with the correction of the violation and/or potential violation.  Nationwide will not be responsible for any improvements, services and/or costs required to comply with any local, state and/or federal laws, regulations,  ordinances<br />\n<br />\n10.4.  Access.  It is your responsibility to provide access to the system or appliance in need of repair or replacement.  In the event that the system or appliance cannot be accessed without causing damage to a wall, floor, cabinet or ceiling, Nationwide will not cover and will not be responsible for any wall coverings, floor coverings, cabinets, counter tops, tiling, paint, or for the repair of any structural or cosmetic defects, including, but not limited to, reconfiguring space to accommodate replacement components.  In the event the Nationwide Service Technician must open a surface to gain access to a component, the surface will be restored to a ruff finish.  In the event the Nationwide Service Technician is required to access a component, appliance or system, either to diagnose, repair or replace the component/appliance, which may or may not be encased, covered or embedded in concrete, Nationwide will not pay more than Five Hundred ($500.00) Dollars total for accessing, diagnosing and repairing/replacing the component/appliance. Appliances and components have a maximum cap of $500.<br />\n<br />\n10.5.  Delay.  Nationwide will not be responsible for delays in repairing or replacing a system or appliance resulting from events beyond its control, including, but not limited to, weather conditions, labor disputes, strikes, delivery problems, war or availability of parts.<br />\n<br />\n10.6.  Upgrades.  This Agreement does not cover upgrades to any system or appliance.<br />\n<br />\n<br />\n11.  Hold Harmless.  You shall keep, save and hold harmless Nationwide from any and all damages and liability arising out of any fault or negligence by You or any failure on Your part to comply with any of the covenants, terms and conditions herein contained.  In case Nationwide shall, without fault on its part, be made a party to any litigation commenced by or against You, You shall protect and hold Nationwide harmless and shall pay all costs, expenses and reasonable attorneys\' fees incurred or paid by Nationwide in connection with such litigation.  You shall also pay all costs, expenses and reasonable attorney\'s fees that may be incurred or paid by Nationwide in enforcing the covenants and terms of this Agreement.<br />\n<br />\n11.1. Change to Terms of Service. Nationwide Home Warranty reserves the right to revise Terms of Service at any time and users are deemed to be apprised of and bound by any changes to these Terms of Service.<br />\n<br />\n12.  Consequential Damages.  This Agreement does not provide coverage for damage caused by a malfunctioning or inoperable appliance or system, including, but not limited to, water, fire and mold spores.  Nationwide, its employees, agents, shareholders or parent company shall in no way be responsible for any damages, whether in contract or tort, for any malfunctioning or inoperable appliance or system. <br />\n<br />\n13.1.  Cancellation by Nationwide.  Nationwide may cancel this Agreement, therefore voiding this Agreement if it is deemed that You have either:<br />\n<br />\n(i)  	Fraudulent conduct by You; <br />\n(ii)  	Misrepresentations by You; <br />\n(iii) 	Failed to make the require payments to Nationwide;<br />\n(iv)  	Upon mutual agreement between You and Nationwide.  In the event Nationwide agrees to allow 			You to cancel after the thirtieth day, the You shall be entitled to a pro rata refund of payments 			made regarding Your home warranty coverage for the remaining term, less an administrative fee 			and any service costs incurred by Nationwide.<br />\n<br />\n13.2.  Cancellation by You.  You may cancel this Agreement within three (3) days from the Order Date of this Agreement, as set forth on the schedule page accompanying this Agreement.  In the event you cancel within the three (3) day period, the You shall be entitled to a full refund of the paid contract fee less a Fifty ($50.00) Dollar administrative fee, if and only if, no service has been provided under the contract.  After the third day, this Agreement shall be non-cancelable by You, unless otherwise agreed by Nationwide.   <br />\n<br />\n14.  Renewal-Transfers.  In the event You wish to renew this Agreement for an additional term, as set forth in the schedule page accompanying this Agreement, You must contact a Nationwide representative prior to the expiration of your current term.  You will be notified by a Nationwide representative as to the new rates and the new terms of coverage.  Nationwide reserves the right to deny your request for renewal for any reason and change the rate and terms of coverage for the renewed term. If the covered property changes ownership during the contract term, please call <strong>718-943-6920</strong> for further information to transfer coverage to the new owner.<br />\n<br />\n14.1.  Automatic Renewal.  In the event You select the monthly payment option and Nationwide elects to renew your contract, Nationwide will notify You of the rate and term for the renewal period during the tenth month of Your contract and You will be automatically renewed for an annual coverage period unless you notify Nationwide in writing thirty (30) days prior to the Termination Date.  Your first payment for the renewed term will be deemed as authorization for another twelve (12) month term.<br />\n<br />\n15.  Arbitration.  Any disputes resulting from this Agreement or any dispute resulting to Nationwides home warranty service shall be construed and enforced under the laws of the State of New York. You hereby submit to the jurisdiction of the courts of Kings County, New York, and waive any objection to venue with respect to actions brought in such courts. <br />\n16.  Severability.  If any provision of these Terms and Conditions is held invalid, illegal, or unenforceable, the validity, legality, or enforceability of the remaining provisions shall in no way be affected or impaired thereby.</p>','2009-06-25 23:43:47','2010-01-13 01:10:07'),(5,'faq','<h1>Frequently Asked Questions</h1>\n<ul>\n	<li>\n		<h4>What is a Home Warranty?</h4>\n		A home warranty is a service contract, usually covering one year, which helps protect homeowners against the cost of unexpected covered repairs or replacement on their major systems and appliances that break down due to normal wear and tear.\n	</li>		\n	<li><h4>Does Nationwide cover everything?</h4>\n		Nationwide does have caps on repairs for systems as well as appliances. Please see our terms and conditions for specific maximum payout information.\n	</li>\n		<h4>I&rsquo;m selling my home. Why would I want a home warranty?</h4>\n		A Nationwide Home Warranty gives buyers additional confidence in a real estate transactionthey know that Nationwide stands behind the covered systems or appliances in the house. If they break down, buyers are covered for repair or replacement. An added benefit to the seller is that buyers will be calling us with their problems &mdash; not you.\n	</li>\n	<li>\n		<h4>I&rsquo;m in the market for a home. What&rsquo;s the benefit of buying a home covered by a Nationwide Home Warranty?</h4>\n		A warranty from Nationwide helps provide protection during and after a home purchase. When a covered system or appliance breaks down due to normal wear and tear, you&rsquo;re protected for repair or replacement. There&rsquo;s no need to get back in touch with the real estate agent or track down the previous owner.\n	</li>\n	<li>\n		<h4>My home systems and appliances are old. Does that matter to Nationwide?</h4>\n		No, the age of a home or its systems and appliances does not matter to Nationwide. We cover items that are in good working condition at the time you purchase the plan and properly maintained. Plus, Nationwide covers all makes and models of appliances and systems.\n	</li>\n	<li>\n		<h4>What if I have an emergency?</h4>\n		Our claims department is available by email at claims@nationwidehomewarranty.com 24 hours, a day 7 days a week.\n	</li>\n	<li>\n		<h4>Does Nationwide need to inspect my home systems and appliances before I enroll?</h4>\n		No, Nationwide home warranty coverage does not require a home inspection to purchase.\n	</li>\n	<li>\n		<h4>Is there a limit to the number of repairs Nationwide covers?</h4>\n		No, Nationwide Home Warranty allows an unlimited number of covered repairs.\n	</li>\n	<li>\n		<h4>What is a trade service call fee?</h4>\n		A trade service call fee is the amount due when a contractor visits your home. Each type of breakdown falls into a &ldquo;trade&rdquo; category, for example: a leaky pipe qualifies as a plumbing breakdown, while a broken dishwasher is an appliance breakdown. \n		<br><br>\n		Since it may require more than one contractor or several unrelated trips to the house by the same contractor (once to fix the pipe, another to fix the dishwasher), there is a fee due for each &ldquo;trade&rdquo; a service call covers. It&rsquo;s perfectly alright to report more than one breakdown at a time. Additional fees may apply if the repairs fall into different categories.\n	</li>\n	<li>\n		<h4>Is a warranty plan from Nationwide renewable?</h4>\n		Yes, warranty-holders may renew their Nationwide plan (at the option of Nationwide). Nationwide Home Warranty will notify the homeowner in advance of the expiration date, and Nationwide will offer a variety of convenient payment plans.\n	</li>\n	<li>\n		<h4>I hold Homeowner&rsquo;s Insurance. Why do I need a home warranty?</h4>\n		Your homeowner&rsquo;s insurance is hazard insurance and covers items damaged in fires, by water, by wind or other covered events. A home warranty repairs or replaces items that break down on their own through normal wear and tear.\n	</li>\n	<li>\n		<h4>When does coverage begin and when does it end?</h4>\n		Coverage for your home&rsquo;s major systems and appliances begins 30 days after you sign up with Nationwide, and the coverage lasts for one year.\n	</li>\n	<li>\n		<h4>Do you offer Discounts for multiple year coverage?</h4>\n		Yes we do. Please call us at <strong>718-943-6920</strong> to speak to a representative about multiple year options.\n	</li>\n	<li>\n		<h4>Does Nationwide Home Warranty cover condos and multiple units?</h4>\n		Yes. Please call <strong>718-943-6920</strong> for pricing.\n	</li>\n	<li>\n		<h4>What is the process to sign up?</h4>\n		You can simply sign up online or call us at <strong>718-943-6920.</strong> We accept all major credit cards as well as check by phone.\n	</li>	\n	<li>\n		\n	</li>\n	<li>\n		<h4>I am selling my home, can Nationwide Home Warranty send me an invoice so the funds can be taken from escrow at closing?</h4>\n		Yes. Nationwide Home Warranty representatives are standing by to assist you.\n	</li>\n	<li>\n		<h4>Do you cover rental properties?</h4>\n		We cover rental properties, mobile homes, manufactured homes, single family and multiple units as well as condos.\n	</li>\n	<li>\n		<h4>What is the process if I have a claim?</h4>\n		Simply email us at claims@nationwidehomewarranty.com 24 hours a day and we will dispatch a local service technician to handle your claim promptly.\n	</li>\n</ul>','2009-07-07 17:09:07','2010-01-13 01:12:07');
