INSERT INTO `email_templates` VALUES (3,'Welcome','Welcome to Select Home Warranty, {customer name}','<p>Congratulations! You are now part of a select group of homeowners who made the intelligent choice of purchasing a home service contract from Select Home Warranty.<p>\n\n<p>This contract will protect your home systems and appliances from sudden break-down and at the same time protect your budget. We will provide you with quality coverage, timely and courteous customer service. This investment will pay for itself.</p>\n\n<p>Please look over your contract agreement and make sure all of the information is correct by browsing to <a href=\"https://www.selecthomewarranty.com/admin/customers/contract/{customer id}\">https://www.selecthomewarranty.com/admin/customers/contract/{customer id}</a>. Alternatively, you may electronically sign your contract by browsing to <a href=\"https://www.selecthomewarranty.com/admin/customers/esign/{customer id}\">https://www.selecthomewarranty.com/admin/customers/esign/{customer id}</a>.</p>\n\n<p>You may log in to our customer administrative interface by navigating to <a href=\"http://www.selecthomewarranty.com/admin/login\">http://www.selecthomewarranty.com/admin/login</a> or by clicking the \"Customer Login\" link on <a href=\"http://www.selecthomewarranty.com\">http://www.selecthomewarranty.com</a></p>\n<p>Your username is your email address: {customer email}</p>\n<p>Your password is: <strong>{the password}</strong></p>\n\n<p>Should you need to make a service call, please call us at <strong>{support phone}</strong>.</p>',1),(4,'Proforma','Proforma Invoice {customer contract_number}','<table cellspacing=\"8\">\n			<tr>\n				<td colspan=\"2\">{image logo}</td>\n			</tr>\n			<tr>\n				<td class=\"label\">Contract:</td>\n				<td>{customer contract_number}</td>\n			</tr>\n			<tr>\n				<td class=\"label\">Buyer Name:</td>\n				<td>{customer name}</td>\n			</tr>\n			<tr>\n				<td class=\"label\">Cvg. Address:</td>\n				<td>{customer full_address}</td>\n			</tr>\n			<tr>\n				<td class=\"label\">Coverage:</td>\n				<td>\n					{customer package_name} for ${customer pay_amount} annually<br>\n					<span class=\"gray\">{customer package_covers}</span>\n				</td>\n			</tr>\n			<tr>\n				<td class=\"label\">&nbsp;</td>\n				<td>{customer coverage_option_names}</td>\n			</tr>\n			<tr>\n				<td class=\"label\">Please send check to:</td>\n				<td>\n					<br><strong>Select Home Warranty<br>\n					100 Church St<br> \n                                        PMB 1003<br>\n					New York, NY 10007<br></strong>\n\n					<a href=\"mailto:info@selecthomewarranty.com\">info@selecthomewarranty.com</a>\n				</td>\n			</tr>\n		</table>\n		<p>\n			What you can expect from Select Home Warranty:<br>\n			<ul>\n				<li>Help in protection from unexpected repair and replacement expenses on covered systems and appliances</li>\n				<li>24-hours a day, seven days a week, one call convenience to our service line</li>\n				<li>Service provided by pre-screened, licensed, and insured local technicians</li>\n			</ul><br>\n			If you have any questions, please call me at <strong>{support phone}</strong>.\n		</p>\n		\n		<p class=\"indent_30\">Thank You,</p>\n		<p class=\"indent_30\"><strong>{my name}</strong></p>',0),(6,'New Web Order','New Web Order, Customer {customer contract_number}','',1),(7,'Join Our Team','Request to Join NHW','<table>\n	<tr>\n		<td class=\"label\">Full Name:</td>\n		<td colspan=\"3\">{the name}</td>\n	</tr>\n	<tr>\n		<td class=\"label\">Company Name:</td>\n		<td colspan=\"3\">{the company_name}</td>\n	</tr>\n	<tr>\n		<td class=\"label\">Email:</td>\n		<td colspan=\"3\">{the email}</td>\n	</tr>\n	<tr>\n		<td class=\"label\">Phone No.:</td>\n		<td colspan=\"3\">{the phone}</td>\n	</tr>\n	<tr>\n		<td class=\"label\">Address:</td>\n		<td colspan=\"3\">{the address}</td>\n	</tr>\n	<tr>\n		<td class=\"label\">City:</td>\n		<td colspan=\"3\">{the city}</td>\n	</tr>\n	<tr>\n		<td class=\"label\">State:</td>\n		<td>{the state}</td>\n		<td class=\"label\">Zip:</td>\n		<td>{the zip}</td>\n	</tr>\n	<tr>\n		<td class=\"label\" style=\"vertical-align: top;\">Comments:</td>\n		<td colspan=\"3\">{the comments}</td>\n	</tr>\n</table>',1),(8,'Become Contractor','Request to become NHW Contractor','<table>\n	<tr>\n		<td class=\"label\">Full Name:</td>\n		<td colspan=\"3\">{the name}</td>\n	</tr>\n	<tr>\n		<td class=\"label\">Company Name:</td>\n		<td colspan=\"3\">{the company_name}</td>\n	</tr>\n	<tr>\n		<td class=\"label\">Email:</td>\n		<td colspan=\"3\">{the email}</td>\n	</tr>\n	<tr>\n		<td class=\"label\">Phone No.:</td>\n		<td colspan=\"3\">{the phone}</td>\n	</tr>\n	<tr>\n		<td class=\"label\">Address:</td>\n		<td colspan=\"3\">{the address}</td>\n	</tr>\n	<tr>\n		<td class=\"label\">City:</td>\n		<td colspan=\"3\">{the city}</td>\n	</tr>\n	<tr>\n		<td class=\"label\">State:</td>\n		<td>{the state}</td>\n		<td class=\"label\">Zip:</td>\n		<td>{the zip}</td>\n	</tr>\n	<tr>\n		<td class=\"label\" style=\"vertical-align: top;\">Comments:</td>\n		<td colspan=\"3\">{the comments}</td>\n	</tr>\n</table>',1),(9,'Billing','Select Home Warranty','<table cellspacing=\"8\">\r\n			<tr>\r\n				<td colspan=\"2\">{image logo}</td>\r\n			</tr>\r\n			<tr>\r\n\r\n\r\nThank you for your purchase from Select Home Warranty contract {customer contract_number}.<br> Failure to contact us in a timely manner will cause a lapse in coverage.<br>\r\n\r\n \r\n\r\n<br>Please take a minute to contact our billing department in reference to your account.<br>\r\n\r\n<br>Thank you, <br>\r\n\r\n<br>Billing Department<br>\r\n\r\n<br>Select Home Warranty<br>\r\n\r\n<br>Phone:  1-(718) 943-6920<br> \r\n\r\n<br>Fax:       1-(718) 943-6924<br>\r\n\r\n<br>http://www.selecthomewarranty.com\r\n<br>\r\n					\r\n<br>P Please don\'t print this email unless you really need to.<br>\r\n\r\n<br><i>Confidential  For Select Home Warranty Internal Use Only: This transmission is intended for the use of the addressee and may contain information that is privileged, confidential and exempt from disclosure under applicable law.  If you are not the intended recipient, or the employee or agent responsible for delivering the message to the intended recipient, you are hereby notified that any dissemination, distribution, or copy of this communication is strictly prohibited.  If you received this communication in error, please notify the sender immediately.</i><br>\r\n\r\n				\r\n \r\n',1),(10,'renewal','Select Home Warranty','<table cellspacing=\"8\">\r\n			<tr>\r\n				<td colspan=\"2\">{image logo}</td>\r\n			</tr>\r\n			<tr>\r\n \r\n\r\n<br>Your business is important to us, please contact our renewal department today to take advantage of special Renewal Rates.<br>{customer contract_number}\r\n\r\n<br>Thank you, <br>\r\n<br>Renewal Department<br>\r\n<br>Select Home Warranty<br>\r\n<br>Phone:  1-(718) 943-6920 <br> \r\n<br>Fax:       1-(718) 943-6924<br>\r\n<br>http://www.selecthomewarranty.com\r\n<br>\r\n					\r\n<br>P Please don\'t print this email unless you really need to.<br>\r\n\r\n<br><i>Confidential  For Select Home Warranty Internal Use Only: This transmission is intended for the use of the addressee and may contain information that is privileged, confidential and exempt from disclosure under applicable law.  If you are not the intended recipient, or the employee or agent responsible for delivering the message to the intended recipient, you are hereby notified that any dissemination, distribution, or copy of this communication is strictly prohibited.  If you received this communication in error, please notify the sender immediately.</i><br>\r\n\r\n				\r\n \r\n',0),(12,'discount code','','<table cellspacing=\"8\">\n			<tr>\n				<td colspan=\"2\">{image logo}</td>\n			</tr>\n			<tr>\n								</td>\n			</tr>\n		</table>\n		<p>Thank you for your interest in a home warranty plan from Select Home Warranty, a leader in the home warranty industry. We have promotions available for customers buying with us for the first time, as well as multi-policy and multi-year discounts. Please call our sales staff or go online and use discount code\n<strong>NWOCT10</strong> and receive a <strong>10% discount</strong>. Use this code for multiple year and multi-policy discounts, even referral discounts.\n\n<tr>\n			<br>What you can expect from Select Home Warranty:</br>\n			<ul>\n				<li>Help in protection from unexpected repair and replacement expenses on covered systems and appliances</li>\n				<li>24-hours a day, seven days a week, one call convenience to our service line</li>\n				<li>Service provided by pre-screened, licensed, and insured local technicians</li>\n			</ul><br>\n			Please take a moment to call our information hotline with any questions and for our latest available promotions, please call us at <strong>{support phone}</strong>.\n		</p>\n		\n		<p class=\"indent_30\">Thank You,</p>\n		<p class=\"indent_30\"><strong>{my name}</strong></p>',0),(13,'New Claim by Customer','New Claim by Customer {customer contract_number}','<strong>Claimed Items:</strong><br>\n{the summary}\n<br>\n<br>\n<strong>Claim:</strong><br>\n{the text}\n',1),(14,'Welcome Contractor','Welcome to Select Home Warranty','Dear {contractor company}, \n<br/><br/>\nThank you for taking an interest in becoming a vendor for Select Home Warranty, a leader in the \nhome warranty industry. Your role as a service provider will go a long way in assuring our customers\' \nsatisfaction.  \n<br/><br/>\nPlease take a minute to complete all attached materials.\n<br/><br/>',1),(16,'Price Quote','Your Price Quote','<table cellspacing=\"8\">\n			<tr>\n				<td colspan=\"2\">{image logo}</td>\n			</tr>\n			<tr>\n				<td class=\"label\">Contract:</td>\n				<td>{customer contract_number}</td>\n			</tr>\n			<tr>\n				<td class=\"label\">Customer Name:</td>\n				<td>{customer name}</td>\n			</tr>\n			<tr>\n				<td class=\"label\">Coverage Address:</td>\n				<td>{customer full_address}</td>\n			</tr>\n			<tr>\n				<td class=\"label\">Coverage:</td>\n				<td>\n					{customer package_name} for ${customer pay_amount} annually<br>\n				<span class=\"gray\">{customer package_covers}</span>\n				</td>\n			</tr>\n			<tr>\n				<td class=\"label\">&nbsp;</td>\n				<td>{customer coverage_option_names}</td>\n			</table>	\n		<p>\n			What you can expect from Select Home Warranty:<br>\n			<ul>\n				<li>Help in protection from unexpected repair and replacement expenses on covered systems and appliances</li>\n				<li>24-hours a day, seven days a week, one call convenience to our service line</li>\n				<li>Service provided by pre-screened, licensed, and insured local technicians</li>\n			</ul><br>\n			If you have any questions, please call me at <strong>{support phone}</strong>.\n		</p>\n		\n		<p class=\"indent_30\">Thank You,</p>\n		<p class=\"indent_30\"><strong>{my name}</strong></p>',0),(17,'Contractor Assigned','Contractor Assigned to Select Home Warranty Claim {customer contract_number}','Dear {customer name},<br/>\r\n<br/>\r\nYour request for service has been assigned to {contractor company}, an authorized Select Home Warranty service technician. You may now contact {contractor company} at {contractor phone}  to schedule a mutually convenient service appointment.<br/>\r\n<br/>\r\nIf you do not have an appointment scheduled with your authorized Select contractor within 48 hours, please call us at 1-718-943-6920 option 2 so that we may assist you in getting an appointment scheduled.<br/>\r\n<br/>\r\nPlease remember that upon the technicians arrival you will be required to pay the {the service_charge} service call fee.\r\nShould you have any questions feel free to call our claims department at 1-718-943-6920.<br/>\r\n <br/>\r\n <br/>\r\nThank you,<br/>\r\nSelect Home Warranty<br/>\r\nClaims Department<br/>\r\n<a href=\"mailto:info@selecthomewarranty.com\">info@selecthomewarranty.com</a><br/>\r\n ',0),(18,'Signed contract Reminder','Signed Contract Reminder','<table cellspacing=\"8\">\r\n			<tr>\r\n				<td colspan=\"2\">{image logo}</td>\r\n			</tr>\r\n			<tr>\r\n\r\n<br>Contract {customer contract_number}<br>Your claim has been placed in our system. Please send back your signed contract as soon as possible so that we may dispatch a contractor in a timely manner. Failure to do so will cause a delay in your service time. <br>\r\nThank you for contacting Select Home Warranty\'s claims department. \r\n \r\n<br>Thank you, <br>\r\n\r\n<br>Claims Department<br>\r\n\r\n<br>Select Home Warranty<br>\r\n\r\n<br>Phone:  1-(718) 943-6920 <br> \r\n\r\n<br>Fax:       1-(718) 943-6924<br>\r\n\r\n<br>http://www.selecthomewarranty.com\r\n<br>\r\n					\r\n<br>P Please don\'t print this email unless you really need to.<br>\r\n\r\n<br><i>Confidential  For Select Home Warranty Internal Use Only: This transmission is intended for the use of the addressee and may contain information that is privileged, confidential and exempt from disclosure under applicable law.  If you are not the intended recipient, or the employee or agent responsible for delivering the message to the intended recipient, you are hereby notified that any dissemination, distribution, or copy of this communication is strictly prohibited.  If you received this communication in error, please notify the sender immediately.</i><br>\r\n',0),(19,'Maintenance Records','Current Claim','Dear Valued Customer,<br>\n\nPlease be advised that your claim is presently pending in our system. We require more information to proceed with your claim 				 Contract :\n				{customer contract_number}.<br> At this time, we are requesting that you supply additional information on the unit in question (i.e. maintenance records/reports, repair records/invoices, etc.) You may fax them to 1-718-943-6924  Attention: Claims Department; or email them to claims@selecthomewarranty.com. Please note, if your claim is time sensitive, poses health concerns, or may result in further damages if not immediately repaired, Select Home Warranry encourages you to have the repairs done out of pocket. You may then submit the above info, along with paid invoice, to be reviewed for possible reimbursement. If you have further questions or concerns, please call us Monday through Friday, 10am to 5pm Eastern Standard Time at 1-718-943-6920 option 2 and ask for a claims manager so that we may assist you further.<br>\n\nThank you,<br>\n\nSelect Home Warranty<br>\n\nClaims Department\n',0),(20,'monthly cancellation','Monthly ','<html>\r\n\r\n            <head>\r\n\r\n                        <style>\r\n\r\n                                    body {\r\n\r\n                                                font-family: Helvetica, Arial, sans-serif;\r\n\r\n                                                line-height: 1.3em;\r\n\r\n                                    }\r\n\r\n                                    \r\n\r\n                                    table td.label {\r\n\r\n                                                vertical-align: top;\r\n\r\n                                                text-align: right;\r\n\r\n                                                width: 120px;\r\n\r\n                                    }\r\n\r\n                                    \r\n\r\n                                    span.gray { color: gray; }\r\n\r\n                                    \r\n\r\n                                    p.indent_30 { text-indent: 30px; }\r\n\r\n                                    \r\n\r\n                                    p.left_30 { margin-left: 30px; }\r\n\r\n                        </style>\r\n\r\n            </head>\r\n\r\n            <body>\r\n\r\n                        {image logo}\r\n\r\n                        <p>Dear Loyal Customer, we regret to inform you that we no longer offer coverage in your area and your plan will expire 30 days after your last monthly payment was taken. We apologize for any inconvenience that this may cause you.<br></p>\r\n\r\n<p>If you have any questions please call us Monday though Friday 10AM - 5PM EST at 1-718-943-6920 prompt 4 for our billing department.<br></p>\r\n\r\n<p class=\"left_30\">\r\n\r\n            Thank you,<br />\r\n\r\n            Billing Department\r\n\r\n</p>\r\n\r\n                        \r\n\r\n                        <p class=\"left_30\">\r\n\r\n                                    {installation name}<br />\r\n\r\n                                   \r\n\r\n \r\n\r\n                        <p class=\"left_30\">\r\n\r\n                                    Please don\'t print this email unless you really need to.<br />\r\n\r\n                                    <br />\r\n\r\n                                    Confidential  For {installation name} Internal Use Only: This transmission is intended for the use of the addressee and may contain information that is privileged, confidential and exempt from disclosure under applicable law.  If you are not the intended recipient, or the employee or agent responsible for delivering the message to the intended recipient, you are hereby notified that any dissemination, distribution, or copy of this communication is strictly prohibited.  If you received this communication in error, please notify the sender immediately.\r\n\r\n                        </p>\r\n\r\n            </body>\r\n\r\n</html>\r\n',0),(21,'NV customers cancellation and prorata offer','Important Update on your Select Home Warranty','\nDear Select Home Warranty Customer:\n\nWe are writing to you regarding your home warranty contract with Select Home Warranty.  Unfortunately, we are no longer offering home warranty contracts in the State of Nevada.  As a current Select Home Warranty contract holder you have two options.  You may either continue to receive services under your contract until the contract terminates (one year after the date on which your contract took effect) or you may choose to receive a pro rata refund of payments made by you for the remaining term of your coverage.  If you wish to continue to receive service under your home warranty contract with us, then you do not need to do anything.  We will continue to provide the high level of customer service which you have come to rely on until your contract terminates.\n\nIf you no longer wish to receive service form us under your home warranty contract, you must notify us by mail that you wish to receive a pro rata refund within 45 days of the date of this email/letter.  Refund requests should be mailed to the following address: \n\nSelect Home Warranty\n2711 Coney Island Avenue, 2nd Floor\nBrooklyn, New York 11235\n\n\n\n\n\nThank you,\n\n\nSelect Home Warranty\n',0),(22,'nv new','Important Update on your Select Home Warranty','<table cellspacing=\"8\">\r\n			<tr>\r\n				<td colspan=\"2\">{image logo}</td>\r\n			</tr>\r\n			<tr>\r\n \r\n<br>Contract {customer contract_number}<br>\r\n<br>We are writing to you regarding your home warranty contract with Select Home Warranty.  Unfortunately, we are no longer offering home warranty contracts in the State of Nevada.  As a current Select Home Warranty contract holder you have two options.  You may either continue to receive services under your contract until the contract terminates (one year after the date on which your contract took effect) or you may choose to receive a pro rata refund of payments made by you for the remaining term of your coverage.  If you wish to continue to receive service under your home warranty contract with us, then you do not need to do anything.  We will continue to provide the high level of customer service which you have come to rely on until your contract terminates.<br>\r\n\r\n<br>If you no longer wish to receive service form us under your home warranty contract, you must notify us by mail that you wish to receive a pro rata refund within 45 days of the date of this email/letter.  Refund requests should be mailed to the following address: <br>\r\n\r\n<br>Select Home Warranty<br>\r\n<br>2711 Coney Island Avenue, 2nd Floor<br>\r\n<br>Brooklyn, New York 11235<br>\r\n\r\n\r\n					\r\n<br>P Please don\'t print this email unless you really need to.<br>\r\n\r\n<br><i>Confidential  For Select Home Warranty Internal Use Only: This transmission is intended for the use of the addressee and may contain information that is privileged, confidential and exempt from disclosure under applicable law.  If you are not the intended recipient, or the employee or agent responsible for delivering the message to the intended recipient, you are hereby notified that any dissemination, distribution, or copy of this communication is strictly prohibited.  If you received this communication in error, please notify the sender immediately.</i><br>\r\n\r\n				\r\n \r\n',0),(23,'No More Service','No More Service','Dear Select Home Warranty Customer:\n\nWe are writing to you regarding your home warranty contract with Select Home Warranty.  Unfortunately, we are no longer offering home warranty contracts in your area.  As a current Select Home Warranty contract holder you  will receive a pro rata refund of payments made by you for the remaining term of your coverage.  \nRest assured any pending claims will be honored.\n\nThank you,\nSelect Home Warranty',0);
